import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom'; // For navigation

const HomePage = () => {
    const navigate = useNavigate();
    const [showProfileMenu, setShowProfileMenu] = useState(false);

    const handleSignOut = () => {
        // Implement logic to handle sign out (e.g., remove token from storage)
        navigate('/signin'); // Redirect to signin page on signout
    };

    const toggleProfileMenu = () => {
        setShowProfileMenu(!showProfileMenu);
    };

    return (
        <div className="flex flex-col min-h-screen bg-gray-100">
            <header className="bg-white py-4 px-6 flex justify-between items-center shadow">
                <div className="flex items-center space-x-4">
                    {/* Logo (You can replace with your logo component or image) */}
                    <div className="h-8 w-8 bg-gray-200 rounded-full"></div>

                    {/* Navigation Links */}
                    <nav className="flex space-x-4">
                        <a href="#" className="text-blue-600 hover:underline">Dashboard</a>
                        <a href="#" className="text-blue-600 hover:underline">Properties</a>
                        <a href="#" className="text-blue-600 hover:underline">Profile</a>
                    </nav>
                </div>

                {/* Profile Dropdown */}
                <div className="relative">
                    <button onClick={toggleProfileMenu} className="flex items-center space-x-2 focus:outline-none">
                        <span className="text-gray-600">Welcome, [User's Full Name]!</span> {/* Replace with actual user's name */}
                        <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6 text-gray-600" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
                        </svg>
                    </button>
                    {showProfileMenu && (
                        <div className="absolute right-0 mt-2 w-48 bg-white rounded-lg shadow-lg py-2 z-10">
                            <button className="block w-full text-left px-4 py-2 text-sm text-gray-600 hover:bg-gray-100" onClick={handleSignOut}>
                                Sign Out
                            </button>
                            <button className="block w-full text-left px-4 py-2 text-sm text-gray-600 hover:bg-gray-100">
                                Profile
                            </button>
                            {/* Add more profile options as needed */}
                        </div>
                    )}
                </div>
            </header>

            {/* Main Content */}
            <main className="flex-grow px-6 py-8">
                <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
                    {/* Quick Actions */}
                    <div className="col-span-1">
                        <h2 className="text-lg font-semibold mb-4">Quick Actions:</h2>
                        <div className="space-y-2">
                            <button className="bg-blue-500 text-white px-4 py-2 rounded-md hover:bg-blue-700 focus:outline-none w-full">
                                View Properties
                            </button>
                            <button className="bg-blue-500 text-white px-4 py-2 rounded-md hover:bg-blue-700 focus:outline-none w-full">
                                Create Maintenance Request
                            </button>
                            <button className="bg-blue-500 text-white px-4 py-2 rounded-md hover:bg-blue-700 focus:outline-none w-full">
                                View Notifications
                            </button>
                            <button className="bg-blue-500 text-white px-4 py-2 rounded-md hover:bg-blue-700 focus:outline-none w-full">
                                Make a Payment
                            </button>
                        </div>
                    </div>

                    {/* Main Content Sections */}
                    <div className="col-span-2 space-y-6">
                        {/* Properties Summary, Maintenance Requests, Notifications */}
                        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
                            <div className="bg-white rounded-lg shadow-md p-4">
                                <h3 className="text-lg font-semibold mb-2">Properties Summary</h3>
                                {/* Add content for properties summary */}
                            </div>
                            <div className="bg-white rounded-lg shadow-md p-4">
                                <h3 className="text-lg font-semibold mb-2">Maintenance Requests</h3>
                                {/* Add content for maintenance requests */}
                            </div>
                            <div className="bg-white rounded-lg shadow-md p-4">
                                <h3 className="text-lg font-semibold mb-2">Notifications</h3>
                                {/* Add content for notifications */}
                            </div>
                        </div>

                        {/* Payments Summary and Featured Properties */}
                        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                            <div className="bg-white rounded-lg shadow-md p-4">
                                <h3 className="text-lg font-semibold mb-2">Payments Summary</h3>
                                {/* Add content for payments summary */}
                            </div>
                            <div className="bg-white rounded-lg shadow-md p-4">
                                <h3 className="text-lg font-semibold mb-2">Featured Properties (scrollable cards)</h3>
                                {/* Add content for featured properties */}
                            </div>
                        </div>

                        {/* Recent Activities */}
                        <div className="bg-white rounded-lg shadow-md p-4">
                            <h3 className="text-lg font-semibold mb-2">Recent Activities:</h3>
                            <ul className="list-disc pl-4 space-y-2">
                                <li>Activity 1</li>
                                <li>Activity 2</li>
                                <li>Activity 3</li>
                            </ul>
                        </div>
                    </div>
                </div>
            </main>

            {/* Footer */}
            <footer className="bg-gray-200 py-4 px-6 text-center text-gray-500">
                <div className="flex justify-center space-x-4">
                    <a href="/contact" className="hover:underline">Contact Info</a>
                    <a href="/privacy-policy" className="hover:underline">Privacy Policy</a>
                    <a href="/terms-of-service" className="hover:underline">Terms of Service</a>
                    <a href="/help-center" className="hover:underline">Help Center</a>
                </div>
                <div className="mt-4">
                    &copy; 2024 Property Management App
                </div>
            </footer>
        </div>
    );
};

export default HomePage;
